import React from "react";
import { connect } from "react-redux";
import getMH from "../Redux/Actions/actions"

class Services extends React.PureComponent {
    render() {
        return (
            <>
                <div className="title">Our services</div>
                <div className="services">
                    <ul>
                        <li><a onClick={() => {
                            this.props.getMensHaircuts();
                        }}>Men's haircut</a></li>
                        <li><a>Women's haircut</a></li>
                        <li><a>Kid's haircut</a></li>
                        <li><a>Hair coloring</a></li>
                        <li><a>Nails extensions</a></li>
                        <li><a>Eyelash extensions</a></li>
                    </ul>
                </div>
            </>
            )
    }
}

function mapStateToProps(state) {
    mensHaircut: state.mensHaircut
}

function mapDispatchToProps(dispatch) {
    getMensHaircuts: () => dispatch(getMH())
}

export default connect(mapStateToProps, mapDispatchToProps)(Services);
